import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [profileData, setProfileData] = useState({
    name: '',
    empId: '',
    email: 'vikash7618@gmail.com',
    phone: '09146030932',
    department: 'IT',
    photo: null
  });
  const [isEditing, setIsEditing] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setProfileData(prev => ({ ...prev, [name]: value }));
  };

  const handleImageChange = (e) => {
    if (e.target.files && e.target.files[0]) {
      let img = e.target.files[0];
      setProfileData(prev => ({ ...prev, photo: URL.createObjectURL(img) }));
    }
  };

  const handleEditToggle = () => {
    setIsEditing(!isEditing);
  };

  const handleSave = (e) => {
    e.preventDefault();
    // Here, you would handle saving the profile data
    setIsEditing(false);
  };

  return (
    <div className="profile-container">
      <div className="profile-header">
        <div className="profile-photo-container">
          {profileData.photo ? (
            <img src={profileData.photo} alt="Profile" className="profile-photo" />
          ) : (
            <div className="profile-photo-placeholder"></div>
          )}
          <input
            type="file"
            accept="image/*"
            onChange={handleImageChange}
            className="photo-upload-input"
            style={{ display: isEditing ? 'block' : 'none' }}
          />
        </div>
        <div className="profile-name-edit">
          {isEditing ? (
            <input 
              value={profileData.name}
              onChange={handleInputChange}
              name="name"
              className="profile-name-input"
            />
          ) : (
            <h1 className="profile-name">{profileData.name}</h1>
          )}
          <span className="edit-profile" onClick={handleEditToggle}>
            {isEditing ? 'Save' : 'Edit'}
          </span>
        </div>
        <div className="profile-status-time">
          <span className="status-indicator"></span>
          <span>Active</span>
          <span className="profile-time">{new Date().toLocaleTimeString()}</span>
        </div>
      </div>
      {isEditing ? (
        <form className="profile-form" onSubmit={handleSave}>
          <input
            type="text"
            placeholder="Employee ID"
            value={profileData.empId}
            onChange={handleInputChange}
            name="empId"
            className="profile-input"
          />
          <input
            type="email"
            placeholder="Email"
            value={profileData.email}
            onChange={handleInputChange}
            name="email"
            className="profile-input"
          />
          <input
            type="tel"
            placeholder="Phone"
            value={profileData.phone}
            onChange={handleInputChange}
            name="phone"
            className="profile-input"
          />
          <input
            type="text"
            placeholder="Department"
            value={profileData.department}
            onChange={handleInputChange}
            name="department"
            className="profile-input"
          />
          <button type="submit" className="save-btn">Save</button>
        </form>
      ) : (
        <div className="profile-info">
          <p>Employee ID: {profileData.empId}</p>
          <p>Email: {profileData.email}</p>
          <p>Phone: {profileData.phone}</p>
          <p>Department: {profileData.department}</p>
        </div>
      )}
    </div>
  );
};

export default Profile;
